import{_ as t,o as n,c as a,z as e,a as o}from"./chunks/framework.9482e208.js";const v=JSON.parse('{"title":"§ 21-377 Notice of sale of delinquent land.","description":"","frontmatter":{},"headers":[],"relativePath":"vacode/21-377.md","filePath":"vacode/21-377.md"}'),s={name:"vacode/21-377.md"},i=e("h1",{id:"§-21-377-notice-of-sale-of-delinquent-land",tabindex:"-1"},[o("§ 21-377 Notice of sale of delinquent land. "),e("a",{class:"header-anchor",href:"#§-21-377-notice-of-sale-of-delinquent-land","aria-label":'Permalink to "§ 21-377 Notice of sale of delinquent land."'},"​")],-1),r=e("p",null,"If any assessment is delinquent for more than a year, the treasurer of the county within which the land assessed lies shall, after the expiration of such year, proceed to sell the land by having notice of such intended sale served on the record owner of the land, if he is a resident of this Commonwealth and his whereabouts herein is known, as process is served in actions at law, by publishing the notice of such sale in a newspaper published or having general circulation in his county, and by posting the notice at the courthouse door; such service, publication and posting shall be not less than thirty days in advance of the date set for the sale. Such publication and posting shall be sufficient notice of the sale to all parties in interest except the owner resident in this Commonwealth. Such notice with the return thereon, if it is served, and the certificate of the treasurer setting forth the date and medium of publication shall be filed by the treasurer in his office.",-1),h=e("p",null,"Code 1919, § 1771; 1924, p. 712; 1926, p. 620; 1936, p. 1035.",-1),l=[i,r,h];function c(d,f,u,p,_,m){return n(),a("div",null,l)}const w=t(s,[["render",c]]);export{v as __pageData,w as default};
